import React, {Fragment} from "react";


const Register = () => {
  return (
    <Fragment>
      <h1>Register</h1>
      <form>
        <input className=" form-control my-3" type="email" name="email" placeholder="email"></input>
        <input className=" form-control my-3" type="password" name="password" placeholder="password"></input>
        <input className=" form-control my-3" type="text" name="name" placeholder="name"></input>
        <button className="btn btn-success btn-block" >Submit</button>
      </form>
    </Fragment>
  )
}

export default Register;
